import { AppbarHeader } from "../../styles/appbar";

export default function AppbarDesktop({matches}){

    return(
        <>
        <h1>DeskTop</h1>
        <AppbarContainer>
            <AppbarHeader>My Bags</AppbarHeader>
        </AppbarContainer>
        </>
    );
};
